import React, { Component } from "react";

const HowTo = () => {
    return(
        <div className="How">
            <p>
                Thank you for using NeighborAid! To
                get started create a request or volunteer to a
                request on the map. When creating a request the category must
                either be "One-Time" or "Material". Either party may mark the 
                request fulfilled. The owner of the request only has 24 hours to 
                re-publish the request if it has not been completed after being marked fulfilled.
            </p>
        </div>
    )
}

export default HowTo;
